  let categorias=[
    'Categoria 1',
    'Categoria 2',
    'Categoria 3',
    'Categoria 4',
    'Categoria 5',
    'Categoria 6',
    'Categoria 7',
    'Categoria 8',
    'Categoria 9',
  ];

  return (
        <Switch>
          <Route path={'/'} component={Home}/>
          <Route path={'/favoritos'} component={Favoritos}/>
        </Switch>
  );
}

export default App;
